"/AnaCristinaCanana/assets/webWireFrame-z9qroVIh.jpg",Sm="/AnaCristinaCanana/assets/digitalWireframe-E0lrIEeQ.png",km="/AnaCristinaCanana/assets/webLowFidelityPrototype-tcKys-jG.jpg",Cm="/AnaCristinaCanana/assets/responsiveMockups-bRcwS9x6.png",Em="/AnaCristinaCanana/assets/usabilityStudyPains-YhdXxiIL.png",Pm="/AnaCristinaCanana/assets/webHomeChanges-wgPjzvQ3.png",jm="/AnaCristinaCanana/assets/webHomeChanges2-tL2Cr5Jp.png",Rm="/AnaCristinaCanana/assets/hifiWeb-VstJHe2e.png",Am="/AnaCristinaCanana/assets/hifiTablet-M3krTPGT.png",Nm="/AnaCristinaCanana/assets/hifiMobile-Cp58Od8z.png";function _m(){return v.jsxs("div",{className:"content-panel taqueria-layout",children:[v.jsx($h,{direction:"column",isCentered:!0,child:v.jsxs(v.Fragment,{children:[v.jsx(Kh,{className:"taqueria-heading",children:"Taqueria Express App and Responsive Web Design"}),v.jsx(Ra,{children:"UX Design | Mobile Interactive Prototype | 2022"})]})}),v.jsx(J,{title:"My Story with Taqueria Express",content:[{type:_.PARAGRAPH,data:"The Taqueria Express responsive web and mobile app design was my first project as a student in Google's UX course. Taqueria Express is one of my favorite authentic Mexican food spots in Charleston, South Carolina. Their popularity has been growing with the years and, as a result, the demand for amazing tacos as well."},{type:_.PARAGRAPH,data:"At lunchtime the wait could go up to an hour some days. Since I was a frequent customer it was very easy for me to socialize with other in the same long wait and hear (and express) the same complaint. These became the potential users of my app design. When I had to choose my first project for the course my immediate thought was 'I never want to wait so long for Mexican food again, I can fix this!' That's how the project was born."},{type:_.IMAGE,data:Yh}]}),v.jsx(J,{title:"Project Overview",content:[{type:_.PARAGRAPH,data:"Taqueria Express responsive web and mobile app is a service that primarily allows users to order food from the Taqueria Express food truck. This food ordering service has been designed to help people order easily online to alleviate the wait times encountered when ordering in person. The secondary goal was to have a modern UI with friendly visual guidelines."}]}),v.jsx("br",{}),v.jsxs("div",{style:{display:"flex",flexDirection:"column",width:"40%"},children:[v.jsxs("div",{style:{display:"flex",paddingBottom:"6px"},children:[v.jsx("div",{style:{fontWeight:"bold",width:"40%"},children:"Project Duration:"}),v.jsx("div",{style:{width:"60%"},children:"February 5th to August 3rd 2022"})]}),v.jsxs("div",{style:{display:"flex",paddingBottom:"6px"},children:[v.jsx("div",{style:{fontWeight:"bold",width:"40%"},children:"Responsibilities:"}),v.jsx("div",{style:{width:"60%"},children:"Plan, design, execute design, user test, and iterate through wireframe, low fidelity, high fidelity, until finally the completed design"})]}),v.jsxs("div",{style:{display:"flex",paddingBottom:"6px"},children:[v.jsx("div",{style:{fontWeight:"bold",width:"40%"},children:"Role:"}),v.jsx("div",{style:{width:"60%"},children:"UX designer, student"})]}),v.jsxs("div",{style:{display:"flex",paddingBottom:"6px"},children:[v.jsx("div",{style:{fontWeight:"bold",width:"40%"},children:"Tools:"}),v.jsx("div",{style:{width:"60%"},children:"Figma, Adobe Xd"})]})]}),v.jsx(J,{title:"Primary Research",content:[{type:_.PARAGRAPH,data:"Starting off, I asked myself initial questions. What is the problem we want to solve? What is the process and emotions that our users experience at the time of ordering food? What are the common user behaviors? What are their frustrations?"},{type:_.PARAGRAPH,data:"After interviewing ten active customers from Taqueria Express, pain points became more clear. Some of them were identified as able to fix and others as able to improve."}]}),v.jsx("br",{}),v.jsx("img",{src:Jh,style:{maxWidth:"50%"}}),v.jsx(J,{title:"Personas",content:[{type:_.PARAGRAPH,data:"The following are two of the personas that were created."},{type:_.IMAGE,data:Xh},{type:_.IMAGE,data:Zh}]}),v.jsx(J,{title:"Storyboard",content:[{type:_.PARAGRAPH,data:"The photos below show the storyboard of a potential user and how their usage of the app could look."},{type:_.PARAGRAPH,data:"The first photo shows the user before and after using the product and their experience at a high level. The focus is on their needs, context, and why the product would be useful for them. They are represented as someone working from an office or home office who does not have time to drive to the taco truck, wait in line, eat, and return to their workstation."},{type:_.IMAGE,data:qh},{type:_.PARAGRAPH,data:"The second storyboard focuses more close-up on the product, showing steps that would all this same user to accomplish their goals."},{type:_.IMAGE,data:bh},{type:_.PARAGRAPH,data:"Based on these sequences I was able to create a journey map that would be the foundation for starting to ideate paper wireframes."}]}),v.jsx(J,{title:"User Journey Map",content:[{type:_.PARAGRAPH,data:"The user journey map was created with the objective of showing what steps would be needed for users to accomplish their goal. The maps shows the steps clearly, shows that only a few steps are needed for each task, and the navigation through the website or app."},{type:_.IMAGE,data:em}]}),v.jsx(J,{title:"Paper Wireframe",content:[{type:_.PARAGRAPH,data:"After having a clear idea of the journey map, I started to sketch and experiment with paper designs. I used techniques like Crazy Eights and Ideate. The picture below represent the final proposition."}]}),v.jsx("br",{}),v.jsxs("div",{style:{display:"grid",gridTemplateColumns:"20% 20% 20% 20%",width:"80%",gap:"1%",marginLeft:"12%"},children:[v.jsx("img",{style:{maxWidth:"100%"},src:tm}),v.jsx("img",{style:{maxWidth:"100%"},src:nm}),v.jsx("img",{style:{maxWidth:"100%"},src:rm}),v.jsx("img",{style:{maxWidth:"100%"},src:lm}),v.jsx("img",{style:{maxWidth:"100%"},src:im}),v.jsx("img",{style:{maxWidth:"100%"},src:om}),v.jsx("img",{style:{maxWidth:"100%"},src:um}),v.jsx("img",{style:{maxWidth:"100%"},src:am})]}),v.jsx(J,{title:"Low Fidelity Prototype",content:[{type:_.PARAGRAPH,data:"Once the paper wireframes were established, I started the low fidelity protoype."},{type:_.IMAGE,data:sm},{type:_.PARAGRAPH,data:"Below is an example of the home page for the mobile app. With this layout we seek to solve one of the pain points: it takes too long to place an order. The menu is placed right in the center and users also have quick access to favorite meals and previous orders giving multiple ways to quickly place an order."}]}),v.jsx("br",{}),v.jsxs("div",{style:{display:"flex",width:"80%"},children:[v.jsx("div",{style:{width:"22%"},children:"Profile and cart buttons are always easy to locate"}),v.jsx("div",{style:{width:"5%",paddingTop:"2%"},children:v.jsx("img",{src:fm,style:{width:"100%"}})}),v.jsx("img",{style:{backgroundColor:"red",maxWidth:"44%"},src:cm}),v.jsx("div",{style:{width:"5%",alignSelf:"end",paddingBottom:"8%"},children:v.jsx("img",{src:Aa,style:{width:"100%"}})}),v.jsx("div",{style:{width:"22%",alignSelf:"end",paddingBottom:"5%"},children:"Home page also displays the previous orders and allows customer to add it to the cart with a single click or tap."})]}),v.jsx("br",{}),v.jsx("div",{style:{width:"80%"},className:"project-content-paragraph",children:"After the customer selects a meal from the menu, all ingredients are in one section. They can select addons and quantities with separate sections for drinks, desserts, and special instructions necessary for their meal."}),v.jsx("br",{}),v.jsxs("div",{style:{display:"flex",width:"80%"},children:[v.jsx("div",{style:{minWidth:"22%"}}),v.jsx("div",{style:{minWidth:"5%"}}),v.jsx("img",{style:{backgroundColor:"red",width:"44%"},src:dm}),v.jsx("div",{style:{minWidth:"5%",alignSelf:"end",paddingBottom:"2%"},children:v.jsx("img",{src:Aa,style:{width:"100%"}})}),v.jsx("div",{style:{minWidth:"22%",alignSelf:"end",paddingBottom:"2%"},children:"The user is also able to exit this page and go back to the menu if they want to completely change the meal being ordered."})]}),v.jsx(J,{title:"Usability Study",content:[{type:_.PARAGRAPH,data:"I conducted two moderated usability studies to determine if users can complete core tasks without being bilingual (the prototype was English only at this point) but with the help of visual cues instead of text. Further, I wanted to determine the overall difficulty of navigating the app. All participants have full-time remote jobs and they usually order food at lunchtime. None were bilingual but all love hispanic food. Half the study participants were hispanic and half were caucasian."},{type:_.IMAGE,data:pm}]}),v.jsx("br",{}),v.jsx("div",{className:"project-content-title",children:"Mockups"}),v.jsx("br",{}),v.jsxs("div",{style:{display:"grid",gridTemplateColumns:"20% 20% 20% 20%",width:"80%",gap:"1%",marginLeft:"12%"},children:[v.jsx("img",{style:{maxWidth:"100%"},src:hm}),v.jsx("img",{style:{maxWidth:"100%"},src:mm}),v.jsx("img",{style:{maxWidth:"100%"},src:vm}),v.jsx("img",{style:{maxWidth:"100%"},src:gm})]}),v.jsx(J,{title:"High-fidelity Prototype",content:[{type:_.IMAGE,data:ym}]}),v.jsx(J,{title:"Accessibility Considerations",content:[{type:_.IMAGE,data:wm}]}),v.jsx("br",{}),v.jsx(Ra,{children:"Responsive Web Design"}),v.jsx(J,{title:"Refining the Design",content:[{type:_.PARAGRAPH,data:"For the responsive web design I took as a base the primary research study and the personas I created for the mobile app. The design was also made consistent with the look and feel of the mobile app, taking basic elements and concepts into consideration."}]}),v.jsx(J,{title:"Paper Wireframe",content:[{type:_.PARAGRAPH,data:"The layout of the webpage is divided in three sections. The first section was created to give the user a warm visual welcome. Lots of colors and vibrant, fresh vegetables are on display with the logo in the middle. On the top right I placed easy access to the menu link, language selection, and hamburger menu which contains less-frequenly used buttons. Scrolling down will also take the user to the core of the webpage: the menu. The third section is designed for the consumers engagement with Taqueria Express social media, contact information, and location."},{type:_.IMAGE,data:xm}]}),v.jsx(J,{title:"Digital Wireframe",content:[{type:_.PARAGRAPH,data:"Three variations are shown below. The first is web (assuming standard display size), next is a tablet view built around 12.9 inch iPad, and the third shown is for mobile built on a Google Pixel 6."},{type:_.IMAGE,data:Sm}]}),v.jsx(J,{title:"Low-fidelity Prototype",content:[{type:_.PARAGRAPH,data:"The user flow for this site was inspired by the order of the process in a line at a buffet. First, you are welcomed to the location before deciding which overall food area interests you. Next you can select individual ingredients, in this case it is proteins, vegetables, tortillas, etc. Finally, addons, drinks, and desserts are available. In the case of the app flow, you end with the option to review and change your order before finalizing it."},{type:_.IMAGE,data:km}]}),v.jsx(J,{title:"Mockups",content:[{type:_.PARAGRAPH,data:"As shown in the prototypes, we can see a comparison of how the site would look on three different size devices."},{type:_.IMAGE,data:Cm}]}),v.jsx(J,{title:"Usability Study",content:[{type:_.PARAGRAPH,data:"After finishing the low-fidelity prototype I executed the first usability study. There were five participants, all local to Charleston and clients of Taqueria Express. The study was unmoderated and lasted about 20-30 minutes."},{type:_.IMAGE,data:Em}]}),v.jsx(J,{title:"Usability Study",content:[{type:_.PARAGRAPH,data:"With the results of the usability study some new findings prompted design changes. A search function was added with a button at the top right as well as quick access to the bag."},{type:_.IMAGE,data:Pm},{type:_.PARAGRAPH,data:"For better accessibility a logo was added to the center of the top bar which navigates back to the site homepage."},{type:_.IMAGE,data:jm}]}),v.jsx(J,{title:"High-fidelity Prototype",content:[{type:_.PARAGRAPH,data:"High-fidelity prototypes for web and tablet layouts were finalized and updates were made to the mobile prototype for consistency."},{type:_.IMAGE,data:Rm},{type:_.IMAGE,data:Am},{type:_.IMAGE,data:Nm}]}),v.jsx(J,{title:"Takeaways",content:[{type:_.PARAGRAPH,data:"I feel extremely happy with the design because every single view has been created while thinking about inclusivity. In the entire process of creating, planning, and designing I was aware of accessibility considerations and I believe that will make a huge difference in the future of UX."}]}),v.jsx("div",{style:{minHeight:"40vh",visibility:"hidden"},children:"hidden"})]})}function Tm(){return v.jsxs("div",{className:"root-container root-background",children:[v.jsx(Mh,{}),v.jsxs(gh,{children:[v.jsx(et,{path:"/",element:v.jsx(yh,{})}),v.jsx(et,{path:"/logos",element:v.jsx(pi,{})}),v.jsx(et,{path:"/photography",element:v.jsx(Oh,{})}),v.jsx(et,{path:"/projects",element:v.jsx(Gh,{})}),v.jsx(et,{path:"/projects/taqueria",element:v.jsx(_m,{})}),v.jsx(et,{path:"/projects/meet",element:v.jsx(pi,{})}),v.jsx(et,{path:"/projects/myorb",element:v.jsx(pi,{})})]})]})}vi.createRoot(document.getElementById("root")).render(v.jsx(Da.StrictMode,{children:v.jsx(Rh,{basename:"/AnaCristinaCanana",children:v.jsx(Tm,{})})}));
